import React, { Suspense } from 'react';
import Header from './Components/Header/';
import Contents from './Components/Contents/';
import Footer from './Components/Footer/';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container>
      <Grid item md={12}>
        <Header />
        <Contents />
        <Footer />
      </Grid>
    </Grid>
  );
}

export default App;
